def is_visible(x1, y1, x2, y2, x3, y3, x4, y4, x5, y5, x6, y6):
    # check if white sheet is fully covered
    if x3 <= x1 and x4 >= x2 and y3 <= y1 and y4 >= y2:
        return False
    if x5 <= x1 and x6 >= x2 and y5 <= y1 and y6 >= y2:
        return False
    # check if white sheet is fully visible
    if x1 >= x3 and x2 <= x4 and y1 >= y3 and y2 <= y4:
        return True
    if x1 >= x5 and x2 <= x6 and y1 >= y5 and y2 <= y6:
        return True
    # check if white sheet is partially visible
    if x1 >= x3 and x2 <= x4 and y1 >= y5 and y2 <= y6:
        return True
    if x1 >= x5 and x2 <= x6 and y1 >= y3 and y2 <= y4:
        return True
    if x1 >= x3 and x2 <= x4 and y1 <= y3 and y2 >= y4:
        return True
    if x1 >= x5 and x2 <= x6 and y1 <= y5 and y2 >= y6:
        return True
    if x1 <= x3 and x2 >= x4 and y1 >= y3 and y2 <= y4:
        return True
    if x1 <= x5 and x2 >= x6 and y1 >= y5 and y2 <= y6:
        return True
    if x1 <= x3 and x2 >= x4 and y1 <= y5 and y2 >= y6:
        return True
    if x1 <= x5 and x2 >= x6 and y1 <= y3 and y2 >= y4:
        return True
    return False

def main():
    x1, y1, x2, y2 = map(int, input().split())
    x3, y3, x4, y4 = map(int, input().split())
    x5, y5, x6, y6 = map(int, input().split())
    if is_visible(x1, y1, x2, y2, x3, y3, x4, y4, x5, y5, x6, y6):
        print('YES')
    else:
        print('NO')

if __name__ == '__main__':
    main()

